import React, { useState } from "react";

import { Field } from "components";

const Game = () => {
  const [field, setField] = useState(
    new Array(9).fill({
      isEmpty: true,
      _id:
        "_" +
        Math.random()
          .toString(36)
          .substr(2, 9)
    })
  );

  console.log(field[0]._id);

  return <Field field={field} />;
};

export default Game;
